const MealPlan = () => {
    return (
        <ListItem sx={{border:'solid 1px',borderColor:'main.primary'}}
            secondaryAction={
                <IconButton edge="end" aria-label="delete">
                    <DeleteIcon />
                </IconButton>
            }
        >
            <ListItemAvatar>
                <Avatar>
                    avatar
                </Avatar>
            </ListItemAvatar>
            <ListItemText
                primary="Single-line item"
            />
        </ListItem>
    )
}

export default MealPlan
